DROP TABLE IF EXISTS `ui_article`;
CREATE TABLE `ui_article` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `type_id` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '文章类型',
  `title` varchar(120) NOT NULL DEFAULT '' COMMENT '文章标题',
  `content` text COMMENT '文章内容',
  `admin_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '创建人',
