INSERT INTO `ui_article` VALUES (1,1,'tt','<p>ddd</p>',53,1505527850,1505527850,1505531421),(2,1,'test1','<p>转转的手机确实用的不错，感觉买到就是赚得到了</p>',53,1505527890,1505527890,NULL),(3,3,'退货流程','<p>巴拉巴拉。。。。。。。。。</p>',1,1505529114,1505529114,NULL),(4,1,'test2','<p>ddddrtrg<img src=\"/public/upload/ueditor/image/20170916/1505531658411383.jpg\" title=\"1505531658411383.jpg\" alt=\"u=311782928,2124121112&amp;fm=200&amp;gp=0.jpg\"/></p>',53,1505530867,1505530867,NULL),(5,1,'mytestww','<p>附加数据，在查询API和支付通知中原样返回，该字段主要用于商户携带订单的自定义数据</p>',53,1505532171,1505532171,NULL),(6,1,'test11','<p>ddddgggg</p>',53,1505532974,1505532974,NULL),(7,2,'积分机制','<p style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255)\"><strong style=\"text-size-adjust: none\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;text-size-adjust: none\">使用场景：</span></strong></p><p style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);text-indent: 28px\"><span style=\"font-family: 宋体, SimSun;text-size-adjust: none\">消费者购买产品后，扫描产品上的积分二维码，获得企业送出的积分；</span></p><p style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);text-indent: 28px\"><span style=\"font-family: 宋体, SimSun;text-size-adjust: none\">促销员销售产品后，扫描产品上的积分二维码，获得企业送出的积分；</span></p><p style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);text-indent: 28px\"><span style=\"font-family: 宋体, SimSun;text-size-adjust: none\">消费者和促销员累计到一定分值后，进入积分商城里兑换商品；</span></p><p style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);text-indent: 28px\"><span style=\"font-family: 宋体, SimSun;text-size-adjust: none\">企业在积分管理后台审核下载兑换记录，发放商品。</span></p><p style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);text-indent: 28px\"><br/></p><p style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255)\"><br/></p><p style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);text-align: center\">&nbsp; &nbsp; &nbsp; &nbsp;<img width=\"142\" height=\"228\" title=\"1503367415392751.png\" alt=\"Screenshot_2017-02-24-16-41-49.png\" src=\"/public/upload/ueditor/image/20171123/1511424270721815.png\"/>&nbsp;&nbsp;<img width=\"141\" height=\"227\" title=\"1503367550109924.png\" alt=\"Screenshot_2017-08-22-09-58-41.png\" src=\"/public/upload/ueditor/image/20171123/1511424271113578.png\"/></p><p style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255)\"><strong style=\"text-size-adjust: none\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;text-size-adjust: none\">二维码积分系统的组成</span></strong></p><p class=\"MsoListParagraph\" style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 24px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255)\"><span style=\"font-family: 宋体, SimSun;text-size-adjust: none\">1、 用户前端积分页面</span></p><p class=\"MsoListParagraph\" style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 24px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255)\"><span style=\"font-family: 宋体, SimSun;text-size-adjust: none\">2、 积分商城</span></p><p class=\"MsoListParagraph\" style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 24px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255)\"><span style=\"font-family: 宋体, SimSun;text-size-adjust: none\">3、 积分后台管理系统</span></p><p class=\"MsoListParagraph\" style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 24px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255)\"><br/></p><p style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255)\"><strong style=\"text-size-adjust: none\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;text-size-adjust: none\">兆信根据多年的从业经验，在产品数字化与一物一码的基础上研发出包含二维码积分功能的产品数字化系统，有以下特点：</span></strong></p><p style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255)\">1、用户体验度好，粘性强，能把用户引流到线上进行二次营销</p><p style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);text-indent: 28px\"><span style=\"font-family: 宋体, SimSun;text-size-adjust: none\">积分便捷：签到、购买、分享、转发、关注、问卷、评论都可获得积分；</span></p><p style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);text-indent: 28px\"><span style=\"font-family: 宋体, SimSun;text-size-adjust: none\">礼品丰富：既有实物商品，又有虚拟商品；</span></p><p style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);text-indent: 28px\"><span style=\"font-family: 宋体, SimSun;text-size-adjust: none\">兑换灵活：积分不够，可以用支付部分现金。</span></p><p style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255)\"><span style=\"font-family: 宋体, SimSun;text-size-adjust: none\">&nbsp;</span></p><p style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255)\">2、配合CRM系统，达到精准营销的目的</p><p class=\"MsoListParagraph\" style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 24px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255)\"><span style=\"font-family: 宋体, SimSun;text-size-adjust: none\">把积分人群进行分类，每类人群有单独的积分策略；</span></p><p class=\"MsoListParagraph\" style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 24px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255)\"><span style=\"font-family: 宋体, SimSun;text-size-adjust: none\">把兑换礼品进行分类，每类人群只能看自己能兑换的礼品。</span></p><p style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255)\">&nbsp;</p><p style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255)\">3、既有标准平台，还能定制</p><p style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);text-indent: 28px\"><span style=\"font-family: 宋体, SimSun;text-size-adjust: none\">用成熟产品，部署快速；</span></p><p style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);text-indent: 28px\"><span style=\"font-family: 宋体, SimSun;text-size-adjust: none\">定制化的系统更能满足个性化的需求。</span></p><p style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);text-indent: 28px\">&nbsp;</p><p style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255)\"><strong style=\"text-size-adjust: none\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;text-size-adjust: none\">二维码积分系统应用流程</span></strong></p><p class=\"MsoListParagraph\" style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 24px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255)\"><span style=\"font-family: 宋体, SimSun;text-size-adjust: none\">1、 需求分析：了解企业对积分系统的需求，是否有个性化定制的部分；</span></p><p class=\"MsoListParagraph\" style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 24px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255)\"><span style=\"font-family: 宋体, SimSun;text-size-adjust: none\">2、 方案设计：根据企业的需求，设计出合理的解决方案，包括标签、页面、流程、软硬件配置、进度等</span></p><p class=\"MsoListParagraph\" style=\"font-family: &#39;Microsoft Yahei&#39;, Arial, Helvetica, sans-serif;text-size-adjust: none;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 24px;color: rgb(51, 51, 51);font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255)\"><span style=\"font-family: 宋体, SimSun;text-size-adjust: none\">3、 方案实施：按方案的具体内容与进度，推动方案进展。</span></p><p><br/></p>',1,1505533978,1505533978,NULL),(8,4,'淘宝双十二','<p>headline</p>',53,1505698885,1505698885,NULL),(9,4,'淘宝双十一','<p>dd<img src=\"/public/upload/ueditor/image/20170918/1505698915601498.jpg\" title=\"1505698915601498.jpg\" alt=\"u=311782928,2124121112&amp;fm=200&amp;gp=0.jpg\"/></p>',53,1505698919,1505698919,NULL),(10,5,'关于我们','<p>关于我们的</p>',53,1505714844,1505714844,NULL),(11,6,'产品介绍1','<p>战展品</p>',53,1505714877,1505714877,NULL),(12,6,'product introduce','<p>introduce<br/></p>',53,1505714916,1505714916,NULL),(13,4,'三月，醉一场青春的流年','<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p style=\"text-align: left;\"><img src=\"/public/upload/ueditor/image/20171110/1510297523132030.jpg\" title=\"1510297523132030.jpg\" alt=\"QC_img.jpg\" width=\"310\" height=\"305\"/></p></li></ol><div style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: left;\">　三月，醉一场青春的流年。慢步在三月的春光里，走走停停，看花开嫣然，看春雨绵绵，感受春风拂面，春天，就是青春的流年。青春，是人生中最美的风景。青春，是一场花开的遇见；青春，是一场痛并快乐着的旅行；青春，是一场轰轰烈烈的比赛；青春，是一场鲜衣奴马的争荣岁月；青春，是一场风花雪月的光阴。</div><div style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: left;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: left;\">　　青春往事，多么甜蜜；青春岁月，多么靓丽；青春流年，如火如荼。青春里，我们向着梦想前进。跌倒过，伤心过，快乐过，痛苦过，孤独过，彷徨过，迷茫过。总是，在悠悠的岁月中徘徊；总是，在如春的生命中成长；总是，在季节的交替中感悟人生四季的美妙与韵律；总是，在多愁善感中体悟青春的美好与无奈。</div><div style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\">　　三月的鲜花，一树树，一束束，一簇簇，而青春，就是像三月的鲜花一样美丽迷人，生机盎然，姹紫嫣红，生机勃勃。三月，是青春里最美最温暖的风景。三月的美，就像青春的美，充满活力，充满生机，充满昂扬的斗志。三月的美，就像青春的花季，在那里我们可以感受青春的跳动与感动，感受青春的曼妙与奇妙；感受青春的悸动与心跳。</div><div style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　青春，如三月的春光，安暖向阳。在美丽的青春年华，我们手牵手，肩并肩，跨过岁月山河，跨过锦瑟流年，跨过天涯海角，在三月的春光里沐浴金色的光泽。三月的春光，让青春的我们看到希望，看到自己有一颗年轻跳动的心，看到蓝天白云，看到明媚的灿烂。三月的春光，温暖无比，就像我们的青春，有着长辈的呵护，有着老师的循循教导，它们就像春光，照耀着我们年轻的心。</div><div style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　青春，如三月的春雨，我们在春雨中得到滋润。春雨，淅淅沥沥，纷纷扬扬，打在青春的雨季，打在我们心里，打在我们的生活里，打在我们的生命中，打在我们的灵魂深处。一场春雨，滋润着我们的青春流年，让我们快乐成长，让我们如沐春雨，让我们感受亲恩。三月的春雨，就像我们的父母，用他们的爱心，滋润着我们幼小不安的心灵。</div><div style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　青春，如三月的春风，我们沐浴在春风里。三月的春风，是我们的朋友，是我们的同窗，是陪伴我们成长的玩伴。因为有了春风，我们感受到友谊的温暖；因为有了春风，我们不再寂寞；因为有了春风，我们总在需要帮助的时候，有他们伸出援助之手。春风，是那样感情丰富，温婉细腻。在春风里，我们跳着，唱着，欢呼着，只因为这如春风的情谊。</div><div style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　青春，如三月的春花，我们陶醉在春花里。三月的春花，是我们的初恋。花开半夏，岁月静好，浅笑安然。三月春花，有着不同的颜色，不同的形状，不同的意向。那水灵灵的粉红的桃花，恋着春风，恋着春雨； 那纯白娇小的茉莉，散发着淡淡的清香；那深红的杜鹃，像燃烧着红色的火焰。初恋，是一种颜色鲜艳的花朵；初恋，是一种幽幽的馨香；初恋，是一种岁月的沉淀。</div><div style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　青春，是三月的风景，美到极致。我们，在三月的春雨中奔跑嬉戏，在春风中感受它的温润，在春光里感受暖暖的温度，在春花里享醉人的芬芳。三月的风景，陪我们一路向梦想的地方进发；三月的风景，让我们路上不再孤独，不再迷茫，不再彷徨；三月的风景，让我们的青春更加色彩斑斓，鸟语花香。</div><div style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　三月，醉一场青春的流年。我们珍惜三月，就像我们珍惜来之不易的幸福青春。三月的雨，三月的风，三月的春光，三月的花香，让我们沉醉不知归路，兴尽晚回舟。在这样一场盛大而清新的流年，我们懂得，青春是一种一去不复返的风景，应当好好保护；青春是一种美丽而活跃的热情，我们必须耐心保持；青春是一种来之不易的懂得，我们必须细心呵护。</div><div style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　三月，醉一场青春的流年。风过无痕，花开向暖。无论是哪一年的三月，都是青春是里最美丽的花朵，都是青春里最难舍的风景，都是青春里最妩媚的清香。无论在哪一年的三月，无论我们有没有老去，心中的青春千万不能割舍，心中的青春永远跳动着快乐，心中的青春永远伴随我们一生一世。</div><div style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　三月，醉一场青春的流年。人生的三月，我们正值青春，风华正茂。在这样一个充满活力的年纪，我们要把握机遇，朝人生的巅峰冲刺；我们要珍惜每一个让我们流连忘返的风景，保持年青的心态，随时准备着与时间赛跑；我们要在时光深处，保持一种淡然而洒脱，矜持而深情的微笑，让三月的风景陪我们笑语盈盈，清芬一路。</div><p><br/></p>',53,1506762590,1506762590,NULL),(14,4,'头条二','<p style=\"margin-top: 0px; margin-bottom: 1em; white-space: normal; padding: 0px; list-style: none; text-indent: 2em; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; background-color: rgb(255, 255, 255);\">世人们总说，<a href=\"http://www.lookmw.cn/html/xinxiuwz/wz-4340.html\" style=\"outline: none; text-decoration-line: none; color: rgb(51, 51, 51);\"><span style=\"color: rgb(0, 0, 0);\">执子之手</span></a>，与子偕老。可是当时过境迁，我们转过身，发现那个曾经约定好一辈子的人早已离去，也许，她已嫁为人妻，也许，最后他的新娘不是你。<br/>　　<br/>　　听谁说，今世的缘是前世的债，菩提树的缘分是五百世的修来的正果，那么，我想这一定是我们最后一次错过。山依在，水依旧，烟雨依然飘散，我在桥边苦等我的倾国倾城，却不见当年桥上人，原来变的是人，是情、<br/>　　<br/>　　三生石上的誓言还在，而当初许下承诺的人们都已散去，不老的是石头，不变的是三生，却偏偏有的人再也等不了，因为岁月催人老，但也让人长大，后来我们明白那时只是年少，那些言辞成了荒唐的笑话。果然，人是聪明的动物，即使犯了错也总有个冠冕堂皇的理由。<br/>　　<br/>　</p><p style=\"text-align:center\"><img src=\"http://essj.baogt.com/public/upload/ueditor/image/20171110/1510298763385091.jpg\" title=\"1510298763385091.jpg\" alt=\"QC_img.jpg\" width=\"207\" height=\"226\"/></p><p style=\"margin-top: 0px; margin-bottom: 1em; white-space: normal; padding: 0px; list-style: none; text-indent: 2em; color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; background-color: rgb(255, 255, 255);\">　<br/></p><ul class=\"diggts list-paddingleft-2\" style=\"list-style-type: none;\"><li><p><br/></p></li></ul><p><span style=\"color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);\">　的确，涸辙之鲋，若不能相濡以沫，相煦以湿，不如相忘于江湖。我遇过很多人，走过很多城，却从未遇见像你这般令我惊心动魄的女子，你的一颦一笑，都令我魂牵梦绕，如今，你转身离去，让我如何把你从我的生命中抹去。每每深夜把酒对月，一次次一遍遍意犹未尽的想起你，那个曾经的人儿，记忆中你的容颜依旧美丽，你的声音依旧清晰，而我在浩瀚的思念中慢慢苍老。如果，如果从未遇见，你仍是你的绝代佳人，我仍是我的旷世奇主，可是，命运让我们相遇了、</span><br/><span style=\"color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);\">　　</span><br/><span style=\"color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);\">　　晨起梳妆，看见镜中日渐消瘦的自己，原来，红颜易老，可那个说好为我披霞戴冠的君人，你的轩车来何迟。我想我已等不到我想要的答案了，你寄予我的最后一封书信，犹字迹清晰的写着，待君归来与汝厮守红尘，当我再打开它时，它的纸张已经微微泛黄。君人，你身在何方，难道已经忘记我们的山盟海誓，还是你遭遇不测…深闺里，十几年如一日的思念，望穿秋水、</span><br/><span style=\"color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);\">　　</span><br/><span style=\"color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);\">　　山无陵，江水为竭，冬雷阵阵，夏雨雪，天地合，乃敢与君绝。可是世界末日还没有到来，我们就已渐行渐远，以至于我看不到你的背影，后来你说，一纸红颜岂值倾尽天下。清明雨上，油纸伞下，谁与谁戏言了三千韶华，时光殆尽，蓦然回首，你不再是我的谁，不再是我一生的执著、</span><br/><span style=\"color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);\">　　</span><br/><span style=\"color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);\">　　浮华的一生，有的人有些事，哭着哭着都忘了，走着走着也就散了，仅留下的，也只是年华过后，故地重游，风兮兮，水易寒，谁人的笙歌婉转，叫我忆起往事，可是，这时谁还会记得谁呢，被想起的那个人是幸福的，而再也记不起的那人谁懂她的泪又沾襟、</span><br/><span style=\"color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);\">　　</span><br/><span style=\"color: rgb(79, 93, 65); font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);\">　　往事化作一缕青烟，在姑苏城外消逝、</span></p>',53,1510298771,1510298771,NULL),(15,3,'哪里能找到我们的实体店','<p>......</p>',1,1511424541,1511424541,NULL);
