#
# Structure for table "ui_goods"
#

DROP TABLE IF EXISTS `ui_goods`;
CREATE TABLE `ui_goods` (
  `goods_id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_sn` varchar(11) NOT NULL DEFAULT '0' COMMENT '商品编号',
  `goods_name` varchar(30) NOT NULL DEFAULT '' COMMENT '商品名称',
  `goods_thums` varchar(255) DEFAULT NULL COMMENT '商品封面',
  `goods_img1` varchar(255) DEFAULT NULL COMMENT '商品图片1',
  `goods_img2` varchar(255) DEFAULT NULL COMMENT '商品图片2',
  `goods_img3` varchar(255) DEFAULT NULL COMMENT '商品图片3',
  `goods_img4` varchar(255) DEFAULT NULL COMMENT '商品图片4',
  `goods_img5` varchar(255) DEFAULT NULL COMMENT '商品图片5',
  `goods_unit` varchar(20) DEFAULT NULL COMMENT '商品单位',
  `cate_id1` int(11) DEFAULT NULL COMMENT '商品一级分类',
  `cate_id2` int(11) DEFAULT NULL COMMENT '商品二级分类',
  `cate_id3` int(11) DEFAULT NULL COMMENT '商品三级分类',
  `shop_cate1` int(11) DEFAULT NULL COMMENT '店铺一级分类',
  `shop_cate2` int(11) DEFAULT NULL COMMENT '店铺二级分类',
  `shop_id` int(11) DEFAULT NULL COMMENT '店铺id',
  `brand_id` int(11) DEFAULT '0' COMMENT '品牌id',
  `model_id` int(11) DEFAULT NULL COMMENT '型号id',
  `market_price` decimal(10,2) DEFAULT NULL COMMENT '市场价格',
  `shop_price` decimal(10,2) DEFAULT '0.00' COMMENT '店铺价格',
  `sale_count` int(11) DEFAULT '0' COMMENT '销售数量',
  `look_num` int(11) DEFAULT '0' COMMENT '浏览量',
  `is_book` tinyint(2) DEFAULT NULL COMMENT '是否预售',
  `book_quantity` int(11) DEFAULT NULL COMMENT '预售数量',
  `is_sale` tinyint(2) DEFAULT '1' COMMENT '是否上架0-否，1-是',
  `is_hot` tinyint(2) DEFAULT '0' COMMENT '是否店铺热门0-否，1-是',
  `is_recom` tinyint(2) DEFAULT '0' COMMENT '是否店铺推荐0-否，1-是',
  `is_new` tinyint(2) DEFAULT '1' COMMENT '是否店铺新品0-否，1-是',
  `recom_desc` varchar(255) DEFAULT NULL COMMENT '推荐描述',
  `recom_sort` tinyint(3) DEFAULT '0' COMMENT '店铺推荐排序',
  `is_admin_hot` tinyint(2) DEFAULT '0' COMMENT '是否商城热门',
  `is_admin_recom` tinyint(2) DEFAULT '0' COMMENT '是否商城推荐',
  `is_admin_new` tinyint(2) DEFAULT '0' COMMENT '是否商城新品',
  `is_check` int(1) DEFAULT '0' COMMENT '审核状态1审核通过0未审核-1审核不通过',
  `admin_recom_sort` tinyint(3) DEFAULT NULL COMMENT '商城推荐排序',
  `create_time` int(11) DEFAULT NULL,
  `update_time` int(11) DEFAULT NULL,
  `delete_time` int(11) DEFAULT NULL,
  `status` int(1) DEFAULT '1' COMMENT '状态 1显示 0隐藏',
  `inventory` int(11) NOT NULL DEFAULT '0' COMMENT '商品库存数量',
  `praise_percentage` decimal(4,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '好评度',
  `courier_fees` decimal(10,2) DEFAULT '0.00' COMMENT '快递费',
  `goods_color_attr` text COMMENT '商品颜色属性',
  `admin_id` int(11) DEFAULT NULL COMMENT '创建人id',
  `store_id` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '卖场id',
  `report_id` int(11) unsigned DEFAULT NULL COMMENT '质检报告id',
  `evaluate` varchar(50) DEFAULT NULL COMMENT '好评标签',
  `giveaway` varchar(255) NOT NULL DEFAULT '' COMMENT '赠品',
  PRIMARY KEY (`goods_id`)
) ENGINE=MyISAM AUTO_INCREMENT=126 DEFAULT CHARSET=utf8 COMMENT='商品表';

