DROP TABLE IF EXISTS `ui_message`;
CREATE TABLE `ui_message` (
  `msg_id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) DEFAULT NULL COMMENT '标题',
  `content` varchar(255) DEFAULT NULL COMMENT '内容',
  `send_uid` int(11) DEFAULT NULL COMMENT '发送者ID',
  `receive_uid` int(11) DEFAULT NULL COMMENT '接收者ID',
  `status` tinyint(1) DEFAULT '0' COMMENT '状态 0未读 1已读',
  `flag` tinyint(1) DEFAULT NULL COMMENT '类型 1系统消息 2其他消息',
  `create_time` int(11) DEFAULT NULL,
  `update_time` int(11) DEFAULT NULL,
  `delete_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`msg_id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

