CREATE TABLE `ui_message_status` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL,
  `article_id` int(11) NOT NULL COMMENT '系统信息ID',
  `status` enum('deleted','read') NOT NULL DEFAULT 'read' COMMENT '系统信息读取状态，read表示已读，deleted表示删除',
  `delete_time` int(11) unsigned DEFAULT NULL,
  `create_time` int(11) unsigned NOT NULL,
  `update_time` int(11) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `user_article` (`user_id`,`article_id`)
) ENGINE=MyISAM AUTO_INCREMENT=143 DEFAULT CHARSET=utf8 COMMENT='用户系统信息读取状态表';

