DROP TABLE IF EXISTS `ui_shipping`;
CREATE TABLE `ui_shipping` (
  `shipping_id` int(11) NOT NULL AUTO_INCREMENT,
  `shipping_code` varchar(25) DEFAULT NULL COMMENT '物流代号',
  `shipping_name` varchar(120) DEFAULT NULL COMMENT '快递名称',
  `shipping_desc` varchar(255) DEFAULT NULL COMMENT '描述',
  `insure` varchar(10) DEFAULT NULL COMMENT '保险',
  `status` tinyint(1) DEFAULT '0' COMMENT '是否开启',
