DROP TABLE IF EXISTS `ui_shopping_cart`;
CREATE TABLE `ui_shopping_cart` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) DEFAULT NULL COMMENT '店铺ID',
  `goods_id` int(11) DEFAULT NULL COMMENT '商品ID',
  `user_id` int(11) DEFAULT NULL COMMENT '买家ID',
  `goods_name` varchar(255) DEFAULT NULL COMMENT '商品名称',
  `good_image` varchar(255) DEFAULT NULL COMMENT '商品图片',
  `market_price` decimal(10,2) DEFAULT NULL COMMENT '原价',
  `present_price` decimal(10,2) DEFAULT NULL COMMENT '成交价',
  `total_price` decimal(10,2) DEFAULT NULL COMMENT '成交总价',
  `despatch_money` decimal(10,2) DEFAULT NULL COMMENT '运费',
  `good_count` int(11) DEFAULT NULL COMMENT '购买数量',
  `good_attr` varchar(255) DEFAULT NULL COMMENT '商品属性',
  `method` varchar(255) DEFAULT NULL COMMENT '运送方式',
  `status` int(11) DEFAULT NULL COMMENT '状态',
  `create_time` int(11) DEFAULT NULL,
  `update_time` int(11) DEFAULT NULL,
  `delete_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=91 DEFAULT CHARSET=utf8 COMMENT='购物车';

