#
# Structure for table "ui_user"
#

DROP TABLE IF EXISTS `ui_user`;
CREATE TABLE `ui_user` (
  `user_id` int(10) NOT NULL AUTO_INCREMENT COMMENT '用户标识',
  `account` varchar(50) NOT NULL DEFAULT '' COMMENT '用户账号',
  `realname` varchar(255) DEFAULT NULL COMMENT '真实姓名',
  `money` decimal(10,2) DEFAULT '0.00' COMMENT '账户余额',
  `nickname` varchar(50) DEFAULT NULL COMMENT '用户昵称',
  `photo` varchar(255) DEFAULT NULL COMMENT '头像',
  `password` varchar(100) NOT NULL DEFAULT '' COMMENT '用户密码',
  `phone` varchar(20) DEFAULT NULL COMMENT '用户手机',
  `email` varchar(255) DEFAULT NULL COMMENT '邮箱',
  `sex` int(1) DEFAULT '0' COMMENT '性别(0 隐私 1 男  2 女  )',
  `birthday` int(11) DEFAULT NULL COMMENT '生日',
  `province` int(10) DEFAULT NULL COMMENT '省',
  `city` int(10) DEFAULT NULL COMMENT '市',
  `area` int(10) DEFAULT NULL COMMENT '区',
  `user_group` int(1) NOT NULL DEFAULT '0' COMMENT '1为管理员;0为普通用户',
  `status` int(1) DEFAULT '1' COMMENT '用户状态（0禁用 1正常）',
  `reg_ip` varchar(255) DEFAULT NULL COMMENT '注册IP',
  `reg_time` int(11) DEFAULT NULL COMMENT '注册时间',
  `last_login_ip` varchar(255) NOT NULL DEFAULT '0.0.0.0' COMMENT '最后登录IP',
  `last_login_time` int(11) NOT NULL DEFAULT '0' COMMENT '最后登录时间',
  `delete_time` int(11) DEFAULT NULL COMMENT '删除时间',
  `create_time` int(11) DEFAULT '0' COMMENT '注册时间',
  `update_time` int(11) DEFAULT NULL COMMENT '更新时间',
  `headimg` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`user_id`)
) ENGINE=MyISAM AUTO_INCREMENT=167 DEFAULT CHARSET=utf8 COMMENT='用户基本信息表';

