#
# Structure for table "ui_user_account_log"
#

DROP TABLE IF EXISTS `ui_user_account_log`;
CREATE TABLE `ui_user_account_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `account_sn` varchar(255) DEFAULT NULL COMMENT '流水号',
  `user_id` int(11) DEFAULT NULL COMMENT '用户ID',
  `target_id` int(11) DEFAULT NULL COMMENT '项目ID',
  `target_type` varchar(255) DEFAULT NULL COMMENT '表名，如：order(订单)',
  `type` enum('in','out') DEFAULT NULL COMMENT 'in-收入 out-支出',
  `amount` decimal(10,2) DEFAULT NULL COMMENT '金额',
  `desc` varchar(255) DEFAULT NULL COMMENT '描述',
  `status` int(2) DEFAULT '1' COMMENT '0->失败；1->成功',
  `create_time` int(11) DEFAULT NULL,
  `update_time` int(11) DEFAULT NULL,
  `delete_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=16 DEFAULT CHARSET=utf8 COMMENT='账户流水表';

